import React from "react";

function App() {
  const src =
    "/https://www.videvo.net/video/close-up-shot-rain-drops-falling-on-leaves/783004/ ";
  return (
    <div>
      <video width="100%" src={src} Type="video/mp4" />;
    </div>
  );
}

export default App;
